  students:Student[]=[
    {
   username:'Wambui Karanja',
   email: 'wambui@thejitu.com',
   password: '12345'
    },
    {
    username:'Esther Wamuyu',
    email: 'wamuyu@thejitu.com',
    password: '12345'
     }

  ]

  getStudents():Student[]{
    return this.students
  }
